/* eslint-disable jsx-a11y/alt-text */
// import { Switch } from "@mui/material";
import React, { Component } from "react";
import { Navbar, Nav } from "react-bootstrap";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import { Container } from "semantic-ui-react";

import Home from '../pages/Home'
import App from '../pages/Form'
import Test from '../pages/Test'

export default class Head extends Component {
  render() {
    return (
      <>
        <Navbar bg="primary" expand="lg">
          <Container>
            <Navbar.Brand href="/home">
              {/* <img src='headimg.png'/> */}
              {/* <img src="unnamed.png" height="50" weight="50" /> */}
              <img src="100-100.png" height="100" weight="100" />
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link href="/home">Главная</Nav.Link>
                <Nav.Link href="/form">форма</Nav.Link>
                <Nav.Link href="/test">Тестовая страница</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
        <Router>
            <Switch>
                <Route exact path="/home" component={Home}/>
                <Route exact path="/form" component={App}/>
                <Route exact path="/test" component={Test}/>
            </Switch>    
        </Router>        
      </>
    );
  }
}
